import React from 'react';
import Header from "../components/Header";
import AddUser from '../components/AddUser';
import UserList from '../components/UserList';

const Update = () => {
  return (<div>
    <center><Header/></center>
    <AddUser/>
    <UserList/>
  </div>);
}


export default Update;
